"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[4362],{30110:(t,e,o)=>{o.r(e),o.d(e,{default:()=>i,johnChapter19PL:()=>n});const n={chapter:19,title:"Jean 19",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"Tedy Pi\u0142at wzi\u0105\u0142 Jezusa, i ubiczowa\u0142 go.",strong:[]},{number:2,text:"A \u017co\u0142nierze upl\xf3t\u0142szy koron\u0119 z ciernia, w\u0142o\u017cyli na g\u0142ow\u0119 jego, i w p\u0142aszcz szar\u0142atny przyodzia\u0142y go;",strong:[]},{number:3,text:"I m\xf3wili: B\u0105d\u017a pozdrowion, kr\xf3lu \u017bydowski! I dawali mu policzkowania.",strong:[]},{number:4,text:"Tedy zasi\u0119 wyszed\u0142 Pi\u0142at, i rzek\u0142 im: Oto wam go wywodz\u0119 precz, aby\u015bcie poznali, \u017ce w nim \u017cadnej winy nie znajduj\u0119.",strong:[{text:"nouveau",strong:"G2537",start:17,end:24},{text:"aucun",strong:"G3762",start:121,end:126}]},{number:5,text:"I wyszed\u0142 Jezus precz, nios\u0105c koron\u0119 cierniow\u0119 i p\u0142aszcz szar\u0142atny. I rzek\u0142 im Pi\u0142at: Oto cz\u0142owiek!",strong:[{text:"homme",strong:"G444",start:102,end:107}]},{number:6,text:"A gdy go ujrzeli przedniejsi kap\u0142ani i s\u0142udzy, zawo\u0142ali, m\xf3wi\u0105c: Ukrzy\u017cuj, ukrzy\u017cuj go! Rzek\u0142 im Pi\u0142at: We\u017amijcie wy go, a ukrzy\u017cujcie; bo ja w nim winy nie znajduj\u0119.",strong:[]},{number:7,text:"Odpowiedzieli mu \u017bydowie: My zakon mamy, a wed\u0142ug zakonu naszego powinien umrze\u0107; bo si\u0119 uczyni\u0142 Synem Bo\u017cym.",strong:[{text:"selon",strong:"G2531",start:51,end:56},{text:"Fils",strong:"G5207",start:107,end:111},{text:"Dieu",strong:"G2316",start:115,end:119}]},{number:8,text:"A gdy us\u0142ysza\u0142 Pi\u0142at to s\u0142owo, wi\u0119cej si\u0119 ul\u0105k\u0142.",strong:[{text:"cette",strong:"G3778",start:22,end:27},{text:"parole",strong:"G3056",start:28,end:34}]},{number:9,text:"I wszed\u0142 zasi\u0119 do ratusza, i rzek\u0142 Jezusowi: Sk\u0105d ty jeste\u015b? Ale mu Jezus odpowiedzi nie da\u0142.",strong:[{text:"dans",strong:"H6887",start:10,end:14}]},{number:10,text:"Tedy mu rzek\u0142 Pi\u0142at: Aza\u017c ze mn\u0105 nie m\xf3wisz? Nie wiesz, \u017ce mam moc ukrzy\u017cowa\u0107 ci\u0119, i mam moc pu\u015bci\u0107 ci\u0119?",strong:[{text:"cher",strong:"G27",start:136,end:140}]},{number:11,text:"Odpowiedzia\u0142 Jezus: Nie mia\u0142by\u015b \u017cadnej mocy przeciwko mnie, by ci nie by\u0142o dano z g\xf3ry; dlatego ten, kt\xf3ry mi\u0119 poda\u0142 tobie, wi\u0119kszy grzech ma.",strong:[{text:"aucun",strong:"G3762",start:36,end:41},{text:"grand",strong:"G3173",start:143,end:148}]},{number:12,text:"Od tego czasu szuka\u0142 Pi\u0142at, jakoby go pu\u015bci\u0142. Ale \u017bydowie wo\u0142ali, m\xf3wi\u0105c: Je\u017ali tego pu\u015bcisz, nie jeste\u015b przyjacielem cesarskim; ka\u017cdy, kto si\u0119 czyni kr\xf3lem, sprzeciwia si\u0119 cesarzowi.",strong:[{text:"cher",strong:"G27",start:41,end:45},{text:"contre",strong:"G2596",start:150,end:156}]},{number:13,text:"A Pi\u0142at us\u0142yszawszy t\u0119 mow\u0119, wywi\xf3d\u0142 Jezusa precz, i usiad\u0142 na stolicy s\u0119dziowskiej, na miejscu, kt\xf3re zowi\u0105 Lithostrotos, a po \u017bydowsku Gabbatha.",strong:[]},{number:14,text:"A by\u0142 pi\u0105tek przygotowania wielkiejnocy, jakoby o godzinie sz\xf3stej, i rzek\u0142 \u017bydom: Oto kr\xf3l wasz!",strong:[]},{number:15,text:"Ale oni wo\u0142ali: Precz z nim, precz! ukrzy\u017cuj go! Rzek\u0142 im Pi\u0142at: Kr\xf3la li waszego mam ukrzy\u017cowa\u0107? Odpowiedzieli przedniejsi kap\u0142ani: Nie mamy kr\xf3la, tylko cesarza.",strong:[]},{number:16,text:"Tedy go wyda\u0142 im, aby by\u0142 ukrzy\u017cowan. I wzi\u0119li Jezusa, i wiedli.",strong:[]},{number:17,text:"A on nios\u0105c krzy\u017c sw\xf3j, wyszed\u0142 na miejsce, kt\xf3re s\u0142ynie czaszka, a \u017bydowsku s\u0142ynie Golgota;",strong:[]},{number:18,text:"Gdzie go ukrzy\u017cowali, i z nim dwa insze, z obu stron, a w po\u015brodku Jezusa.",strong:[{text:"deux",strong:"G1417",start:32,end:36},{text:"avec",strong:"G1848",start:44,end:48},{text:"chaque",strong:"G3956",start:60,end:66}]},{number:19,text:"I napisa\u0142 te\u017c i napis Pi\u0142at, i wprawi\u0142 go na krzy\u017c; a by\u0142o napisano: JEZUS NAZARE\u0143SKI, KR\xd3L \u017bYDOWSKI.",strong:[]},{number:20,text:"Ten tedy napis czyta\u0142o wiele \u017byd\xf3w; bo by\u0142o blisko miasta miejsce, gdzie by\u0142 ukrzy\u017cowan Jezus, a by\u0142o napisano po \u017bydowsku, Grecku, i \u0141aci\u0144sku.",strong:[{text:"Beaucoup",strong:"G4183",start:0,end:8},{text:"cette",strong:"G3778",start:25,end:30},{text:"grec",strong:"G1672",start:133,end:137}]},{number:21,text:"I m\xf3wili Pi\u0142atowi przedniejsi kap\u0142ani \u017bydowscy: Nie pisz: Kr\xf3l \u017bydowski; ale \u017ce on rzek\u0142: Kr\xf3lem \u017bydowskim jestem.",strong:[]},{number:22,text:"Odpowiedzia\u0142 Pi\u0142at: Com napisa\u0142, napisa\u0142em.",strong:[]},{number:23,text:"\u017bo\u0142nierze tedy, gdy ukrzy\u017cowali Jezusa, wzi\u0119li szaty jego, i uczynili cztery cz\u0119\u015bci, ka\u017cdemu \u017co\u0142nierzowi po cz\u0119\u015bci, i sukni\u0105. A by\u0142a suknia nie szyta, ale w ca\u0142o\u015bci od wierzchu utkan.",strong:[{text:"avoir",strong:"G1372",start:19,end:24},{text:"chaque",strong:"G3956",start:109,end:115},{text:"seul",strong:"G3439",start:183,end:187}]},{number:24,text:"I m\xf3wili mi\u0119dzy sob\u0105: Nie rozdzierajmy jej, ale rzu\u0107my los o ni\u0119, czyja b\u0119dzie; aby si\u0119 wype\u0142ni\u0142o Pismo, kt\xf3re m\xf3wi: Rozdzielili sobie szaty moje, a o sukni\u0105 moj\u0119 metali los. To tedy uczynili \u017co\u0142nierze.",strong:[{text:"cette",strong:"G3778",start:116,end:121},{text:"parole",strong:"G3056",start:122,end:128}]},{number:25,text:"A sta\u0142y u krzy\u017ca Jezusowego matka jego, i siostra matki jego, Maryja, \u017cona Kleofasza, i Maryja Magdalena.",strong:[]},{number:26,text:"Tedy Jezus ujrzawszy matk\u0119, i ucznia stoj\u0105cego, kt\xf3rego mi\u0142owa\u0142, rzek\u0142 matce swojej: Niewiasto! oto syn tw\xf3j.",strong:[{text:"disciple",strong:"G3101",start:43,end:51},{text:"fils",strong:"G5207",start:98,end:102}]},{number:27,text:"Potem rzek\u0142 onemu uczniowi: Oto matka twoja. I od onej godziny wzi\u0105\u0142 j\u0105 on ucze\u0144 do siebie.",strong:[{text:"disciple",strong:"G3101",start:15,end:23},{text:"disciple",strong:"G3101",start:62,end:70}]},{number:28,text:"Potem wiedz\u0105c Jezus, \u017ce si\u0119 ju\u017c wszystko wykona\u0142o, aby si\u0119 wype\u0142ni\u0142o Pismo, rzek\u0142: Pragn\u0119.",strong:[{text:"tout",strong:"G3956",start:34,end:38},{text:"soif",strong:"G1372",start:105,end:109}]},{number:29,text:"A sta\u0142o naczynie pe\u0142ne octu; tedy oni nape\u0142niwszy g\u0105bk\u0119 octem, i na hizop w\u0142o\u017cywszy, przy\u0142o\u017cyli do ust jego.",strong:[]},{number:30,text:"A gdy wzi\u0105\u0142 Jezus ocet, rzek\u0142: Wykona\u0142o si\u0119. A nak\u0142oniwszy g\u0142owy, odda\u0142 ducha.",strong:[{text:"Tout",strong:"G3956",start:42,end:46},{text:"esprit",strong:"G4151",start:95,end:101}]},{number:31,text:"Tedy \u017bydowie, (aby nie zosta\u0142y na krzy\u017cu cia\u0142a w sabat, gdy\u017c by\u0142 pi\u0105tek przygotowania; bo wielki by\u0142 dzie\u0144 on sabatu,) prosili Pi\u0142ata, aby im \u0142amano golenie, i aby byli zdj\u0119ci.",strong:[{text:"Dans",strong:"H6887",start:0,end:4},{text:"corps",strong:"G4561",start:24,end:29},{text:"jour",strong:"H3117",start:111,end:115},{text:"grand",strong:"G3173",start:135,end:140},{text:"jour",strong:"H3117",start:141,end:145}]},{number:32,text:"Przyszli tedy \u017co\u0142nierze, i pierwszemu z\u0142amali golenie, i drugiemu, kt\xf3ry by\u0142 ukrzy\u017cowan z nim.",strong:[{text:"premier",strong:"G4413",start:57,end:64},{text:"avec",strong:"G1848",start:104,end:108}]},{number:33,text:"Ale gdy przyszli do Jezusa, a ujrzeli, \u017ce ju\u017c umar\u0142, nie \u0142amali goleni jego.",strong:[{text:"mort",strong:"H6757",start:46,end:50}]},{number:34,text:"Ale jeden z \u017co\u0142nierz\xf3w w\u0142\xf3czni\u0105 bok jego przebi\u0142, i wnet\u017ce wysz\u0142a krew i woda.",strong:[{text:"avec",strong:"G1848",start:38,end:42}]},{number:35,text:"A ten, kt\xf3ry to widzia\u0142, \u015bwiadectwo wyda\u0142, a prawdziwe jest \u015bwiadectwo jego, i on wie, \u017ce m\xf3wi prawd\u0119, aby\u015bcie i wy wierzyli.",strong:[]},{number:36,text:"Bo si\u0119 to sta\u0142o, aby si\u0119 Pismo wype\u0142ni\u0142o: Ko\u015b\u0107 jego nie b\u0119dzie z\u0142amana.",strong:[{text:"Aucun",strong:"G3762",start:61,end:66}]},{number:37,text:"I zasi\u0119 drugie Pismo m\xf3wi: B\u0119d\u0105 patrze\u0107 na\u0144, kt\xf3rego przebili.",strong:[]},{number:38,text:"A potem prosi\u0142 Pi\u0142ata J\xf3zef z Arymatyi, (kt\xf3ry by\u0142 uczniem Jezusowym, ale tajemnym, dla boja\u017ani \u017bydowskiej,) aby wzi\u0105\u0142 cia\u0142o Jezusowe; i dopu\u015bci\u0142 Pi\u0142at. Przyszed\u0142 tedy, i wzi\u0105\u0142 cia\u0142o Jezusowe.",strong:[{text:"disciple",strong:"G3101",start:42,end:50},{text:"prendre",strong:"G3880",start:133,end:140},{text:"corps",strong:"G4561",start:144,end:149},{text:"corps",strong:"G4561",start:206,end:211}]},{number:39,text:"I przyszed\u0142 te\u017c i Nikodem, (ten, kt\xf3ry by\u0142 przyszed\u0142 do Jezusa w nocy po raz pierwszy,) nios\u0105c z\u0142o\u017cenie myrry i aloesu, jakoby funt\xf3w sto.",strong:[{text:"nuit",strong:"G3571",start:39,end:43}]},{number:40,text:"I wzi\u0119li cia\u0142o Jezusowe, i owin\u0119li je w p\u0142\xf3tna z wonnemi rzeczami, jako jest zwyczaj \u017bydom chowa\u0107.",strong:[{text:"corps",strong:"G4561",start:20,end:25},{text:"avec",strong:"G1848",start:66,end:70},{text:"comme",strong:"G2531",start:85,end:90}]},{number:41,text:"A by\u0142o na onemmiejscu, gdzie by\u0142 ukrzy\u017cowan, ogr\xf3d, a w ogrodz\u0119 gr\xf3b nowy, w kt\xf3rym jeszcze \u017caden nie by\u0142 po\u0142o\u017cony.",strong:[{text:"dans",strong:"H6887",start:25,end:29},{text:"dans",strong:"H6887",start:70,end:74},{text:"personne",strong:"G3762",start:106,end:114}]},{number:42,text:"Tam tedy dla przygotowania \u017bydowskiego, (\u017ce by\u0142 blisko gr\xf3b,) po\u0142o\u017cyli Jezusa.",strong:[]}]},i=n}}]);
